event.script:

var $decision = choice("Make your choice:", 
    array("Mochi Team!","One Mochi","Shop","Sell","Nevermind"));
switch($decision){
    case 0:
        startBattle("Green Tea Mochi",3,false,"grasslands");
    break;
    case 1:
        startBattle("Green Tea Mochi",1,false,"grasslands");
    break;
    case 2:
        var @items = array(getNamedItem("Moon Seed"), getNamedItem("Sun Seed"), randomItem($_DROP_UNCOMMON,100,400));
        shop(@items);
    break;
    case 3:
        sell();
    break;
    default:
        say("Podium","Very well.");
    break;

}

var @options = array("You" , "The other cat" , "Alan" , "Option 3" , "Option 4" , "Option 5" , "Option 6");
var $decision = choice( "Who is your Favorite cat?", @options);
switch($decision)
{
    case 0:
        say("Leroy","Thank you! Take this key.");
        giveItem(getNamedItem("Octavia Key"),1,false);
        break;
    default:
        say("Leroy", "No, not " + @options[$decision]);
        break;
}


var @array = getPartyArray();

foreach (declare $character) in @array
{
    doDamage($character,0-getCharacterAttribute($character,$_MAXHP)-getCharacterAttribute($character,$_HP));
    print(getCharacterName($character) + " HP = " + getCharacterAttribute($character,$_HP));
    setCharacterToggle($character,$_ALIVE,true);
}
declare $item = randomItem($_DROP_RARE,100,4000);
if(is_valid($item))
    giveItem($item,1,false);
